import React from 'react';
import { motion } from 'framer-motion';
import { Camera, MapPin, Users, Award } from 'lucide-react';
import './About.css';

const About = () => {
  const features = [
    {
      icon: <Camera size={32} />,
      title: "Professional Photography",
      description: "High-quality aerial photography capturing Turkey's most beautiful landscapes and landmarks."
    },
    {
      icon: <MapPin size={32} />,
      title: "Wide Coverage",
      description: "Extensive coverage across Turkey, from bustling cities to serene countryside locations."
    },
    {
      icon: <Users size={32} />,
      title: "Expert Team",
      description: "Experienced photographers and pilots dedicated to delivering exceptional results."
    },
    {
      icon: <Award size={32} />,
      title: "Quality Guarantee",
      description: "Commitment to excellence with every project, ensuring client satisfaction."
    }
  ];

  return (
    <section id="about" className="about">
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">About Above Turkey</h2>
          <p className="section-subtitle">
            We specialize in capturing the beauty of Turkey from unique aerial perspectives
          </p>
        </motion.div>

        <div className="about-content">
          <motion.div
            className="about-text"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            viewport={{ once: true }}
          >
            <h3>Our Story</h3>
            <p>
              Above Turkey was founded with a passion for showcasing the incredible beauty and diversity of Turkey from above. 
              Our team of experienced aerial photographers and pilots work together to capture stunning images and videos 
              that tell the story of this remarkable country.
            </p>
            <p>
              From the historic streets of Istanbul to the pristine beaches of the Mediterranean, from the dramatic landscapes 
              of Cappadocia to the modern architecture of Ankara, we bring you perspectives that ground-level photography simply cannot achieve.
            </p>
            <div className="about-stats">
              <div className="stat">
                <div className="stat-number">5+</div>
                <div className="stat-label">Years Experience</div>
              </div>
              <div className="stat">
                <div className="stat-number">1000+</div>
                <div className="stat-label">Photos Captured</div>
              </div>
              <div className="stat">
                <div className="stat-number">25+</div>
                <div className="stat-label">Cities Covered</div>
              </div>
            </div>
          </motion.div>

          <motion.div
            className="about-image"
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            viewport={{ once: true }}
          >
            <div className="image-placeholder">
              <div className="placeholder-content">
                <span>About Image</span>
                <p>Our team in action</p>
              </div>
            </div>
          </motion.div>
        </div>

        <motion.div
          className="features-grid"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
          viewport={{ once: true }}
        >
          {features.map((feature, index) => (
            <motion.div
              key={index}
              className="feature-card"
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
            >
              <div className="feature-icon">
                {feature.icon}
              </div>
              <h4 className="feature-title">{feature.title}</h4>
              <p className="feature-description">{feature.description}</p>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default About;
